import './App.css';
import { Container } from '@mui/system';
import { Grid } from '@mui/material';
import { BrowserRouter, Route, Routes } from "react-router-dom";

import Header from './components/Header/Header';
import Footer from './components/Footer/Footer';
import Profile from './components/Profile/Profile';
import Resume from './pages/Resume/Resume';
import Portfolio from './pages/Portfolio/Portfolio';

function App() {
  return (
      <Container className="top_60">
          <Grid container item xs={12} spacing={3} style={{maxHeight: '100vh', overflow: 'auto'}}>
            <Grid item xs={12} md={4}>
              <Profile />
            </Grid>
            <BrowserRouter>
              <Grid container item xs={12} md={8}>
                <Grid container item className="header">
                  <Header />
                </Grid>
                <Grid container item style={{backgroundColor: "green"}}>
                    <Routes>
                      <Route path='/' component={Resume} /> 
                      <Route path='/portfolio' component={Portfolio} />
                    </Routes>
                </Grid>
                <Grid container item style={{backgroundColor: "blue"}}>
                  <Footer />
                </Grid>
              </Grid>
            </BrowserRouter>
          </Grid>
      </Container>
  );
}

export default App;
